import React from 'react';
import { Route, Navigate } from 'react-router-dom';

const ProtectedRoute = ({ element: Element, isAuthorized }) => {
    return (
        <Route
            render={(props) => 
                isAuthorized ? (
                    <Element {...props} />
                ) : (
                    <Navigate to="/forgot-password" /> // Redirect to forgot password if not authorized
                )
            }
        />
    );
};

export default ProtectedRoute;
